Smiltynės perkėlos programėlė – tai Informacijos šaltinis, kuriame rasite   keltų maršrutų tvarkaraščius ir kainas. Taip pat tai įrankis, kuriuo pėstieji galės įsigyti bilietus.
Tvarkaraščių informacija Jūsų programėlėje atsinaujins automatiškai, tad net keltams plaukiant be grafiko, apie tai bus pranešta.
Jūsų patogumui taip pat galėsite:
• matyti Naujosios perkėlos maršruto Klaipėda-Smiltynė-Klaipėda tvarkaraštį ir kainoraštį;
• matyti Senosios perkėlos Klaipėda-Smiltynė-Klaipėda tvarkaraštį ir kainoraštį;
• stebėti tiesioginę transliaciją iš perkėlų;
• stebėti pranešimus, kai keltų darbas nutraukiamas dėl oro ar kitų ekstremalių sąlygų.
